    false,nt"url": null,nt"notes": "NAIP imagery is available for distribution
    within 60 days of the end of a flying season and is intended to provide current
    information of agricultural conditions in support of USDA farm programs. For USDA
    Farm Service Agency, the 1 meter GSD product provides an ortho image base for Common
    Land Unit boundaries and other data sets. The 1 meter NAIP imagery is generally
    acquired in projects covering full states in cooperation with state government and
    other federal agencies who use the imagery for a variety of purposes including land
    use planning and natural resource assessment. With an annual cycle, NAIP is also
    used for disaster response often providing the most current pre-event imagery. While
    suitable for a variety of uses the 2 meter GSD NAIP imagery is primarily intended
    to assess crop condition and compliance to USDA farm program conditions. The 2 meter
    imagery is generally acquired only for agricultural areas within state projects.",nt"owner_org":
